import React from 'react';
import './App.css';
import json from './data.json';
import Mark from './components/mark';

function App() {
  const clauseCounter = React.createRef();
  return (
    <div className="App">
      {
        json.map(obj, index => <Mark key={index} {...obj} clauseCounter={clauseCounter} />)
      }
    </div>
  );
}

export default App;
